import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Btnlg from './btn/Btnlg';
import axios from 'axios';
import Validation from "./Validation";

function Inscrire() {
  // INITIALISATION DES VALEURS
    const [values, setValues] = useState({
      pseudoUser: '',
      mailUser: '',
      birthdayUser: '',
      passwordUser: ''
    })

    const [errors, setErrors] = useState({});

    const navigate = useNavigate();

    const handleInput = (event) => {
      setValues(prev=> ({...prev,[event.target.name]: [event.target.value]}))
    }

    const register = (event) => {
      event.preventDefault();
      setErrors(Validation(values));
      if(errors.pseudoUser === "" && errors.mailUser === "" && errors.birthdayUser === "" && errors.passwordUser === "" ){
        axios.post('http://localhost:3001/register', 
        {pseudoUser: pseudoReg, mailUser: mailReg, birthdayUser: birthdayReg, passwordUser: passwordReg})
        .then(res => [
          navigate('/')
        ])
        .catch(err => console.log(err));
      }
  }

    return (
        <section className="registerPage">
        <h3 className="text-center mt-2 createNewAccount">Création d'un nouveau compte</h3>
        <p className="text-center text-secondary completeForm">Veuillez renseigner le formulaire ci-dessous.</p>
        <div className="blocRegister">
        <form onSubmit={register} method="POST" className="formConnect text-center border border-dark p-3 rounded">
          <div className="mb-1">
            <label htmlFor="exampleInput" className="form-label">Pseudo</label>
            <input onChange={handleInput} type="text" className="form-control" id="pseudo" name="pseudoUser" autoComplete="off"/>
            {errors.pseudoUser && <span className="text-danger">{errors.pseudoUser}</span>}
          </div>
          <div className="mb-1">
            <label htmlFor="exampleInput" className="form-label">Adresse mail</label>
            <input onChange={handleInput} type="mail" className="form-control" id="mail" name="mailUser" autoComplete="off"/>
            {errors.mailUser && <span className="text-danger">{errors.mailUser}</span>}
          </div>
          <div className="mb-1">
            <label htmlFor="exampleInput" className="form-label">Date de naissance</label>
            <input onChange={handleInput} type="date" className="form-control" id="birthday" name="birthdayUser" autoComplete="off" title="âge requis : 13 ans minimum" max="2010-12-01"/>
            {errors.birthdayUser && <span className="text-danger">{errors.birthdayUser}</span>}
          </div>
          <div className="mb-1">
            <label htmlFor="exampleInput" className="form-label">Mot de passe</label>
            <input onChange={handleInput} type="password" className="form-control" id="passw" name="passwordUser" autoComplete="off"/>
            {errors.passwordUser && <span className="text-danger">{errors.passwordUser}</span>}
          </div>
          <div className="mb-1">
            <div className="form-check">
              <input className="form-check-input" type="checkbox" id="gridCheck"/>
              <label className="form-check-label accepterConditions" htmlFor="gridCheck">Accepter les <Link className="conditionsUtili" to="/conditions">conditions d'utilisation</Link></label>
            </div>
          </div>
          <Btnlg  type="submit" className="btn" caracteristique="lg" text="Confirmer l'inscription"/>
          </form>
        </div>
        <div className="accountExist">
            <p>Déjà un compte ? <Link to="/" className="connectVous">Se connecter !</Link></p>
          </div>
        </section>
    );
  }

  export default Inscrire;
